import styled from "styled-components";

export const LogoutButton = styled.button`
  text-align: center;
  width: 100px;
  height: 40px;
  color: white;
  background-color: red;
  border-radius: 3px;
  border: 1px solid red;
  margin-top: 100px;
`;

export const ContainerDiv = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 60px;
`;

